class Layout extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            current: 'Alpha'
        }
    }

    propers = getInitialProps();
    render() {
        return (
            <div>
            <Head>
                <title>Greek Tv</title>
                <link href="https://bootswatch.com/4/solar/bootstrap.css" rel="stylesheet"/>
            </Head>
            <NavBar />
            <h2>Availiable Channels</h2>
            <Channels />
            {propers.children} 
            </div>
        )
    }


}


export default Layout;
